PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE [core_store] (
   [id] INTEGER PRIMARY KEY,
   [key] TEXT,
   [value] TEXT,
   [type] TEXT,
   [environment] TEXT,
   [tag] TEXT
);
CREATE TABLE [strapi_webhooks] (
   [id] INTEGER,
   [name] TEXT,
   [url] TEXT,
   [headers] TEXT,
   [events] TEXT,
   [enabled] INTEGER
);
CREATE TABLE [strapi_permission] (
   [id] INTEGER PRIMARY KEY,
   [action] TEXT,
   [subject] TEXT,
   [properties] TEXT,
   [conditions] TEXT,
   [role] INTEGER,
   [created_at] TEXT,
   [updated_at] TEXT
);
CREATE TABLE [strapi_role] (
   [id] INTEGER PRIMARY KEY,
   [name] TEXT,
   [code] TEXT,
   [description] TEXT,
   [created_at] TEXT,
   [updated_at] TEXT
);
CREATE TABLE [strapi_administrator] (
   [id] INTEGER PRIMARY KEY,
   [firstname] TEXT,
   [lastname] TEXT,
   [username] TEXT,
   [email] TEXT,
   [password] TEXT,
   [resetPasswordToken] TEXT,
   [registrationToken] TEXT,
   [isActive] INTEGER,
   [blocked] TEXT,
   [preferedLanguage] TEXT
);
CREATE TABLE [strapi_users_roles] (
   [id] INTEGER PRIMARY KEY,
   [user_id] INTEGER,
   [role_id] INTEGER
);
CREATE TABLE [i18n_locales] (
   [id] INTEGER PRIMARY KEY,
   [name] TEXT,
   [code] TEXT,
   [created_by] TEXT,
   [updated_by] TEXT,
   [created_at] TEXT,
   [updated_at] TEXT
);
CREATE TABLE [upload_file] (
   [id] INTEGER PRIMARY KEY,
   [name] TEXT,
   [alternativeText] TEXT,
   [caption] TEXT,
   [width] TEXT,
   [height] TEXT,
   [formats] TEXT,
   [hash] TEXT,
   [ext] TEXT,
   [mime] TEXT,
   [size] FLOAT,
   [url] TEXT,
   [previewUrl] TEXT,
   [provider] TEXT,
   [provider_metadata] TEXT,
   [created_by] TEXT,
   [updated_by] TEXT,
   [created_at] TEXT,
   [updated_at] TEXT
);
CREATE TABLE [upload_file_morph] (
   [id] INTEGER PRIMARY KEY,
   [upload_file_id] INTEGER,
   [related_id] INTEGER,
   [related_type] TEXT,
   [field] TEXT,
   [order] INTEGER
);
CREATE TABLE [users-permissions_permission] (
   [id] INTEGER PRIMARY KEY,
   [type] TEXT,
   [controller] TEXT,
   [action] TEXT,
   [enabled] INTEGER,
   [policy] TEXT,
   [role] INTEGER,
   [created_by] TEXT,
   [updated_by] TEXT
);
CREATE TABLE [users-permissions_role] (
   [id] INTEGER PRIMARY KEY,
   [name] TEXT,
   [description] TEXT,
   [type] TEXT,
   [created_by] TEXT,
   [updated_by] TEXT
);
CREATE TABLE [users-permissions_user] (
   [id] INTEGER,
   [username] TEXT,
   [email] TEXT,
   [provider] TEXT,
   [password] TEXT,
   [resetPasswordToken] TEXT,
   [confirmationToken] TEXT,
   [confirmed] INTEGER,
   [blocked] INTEGER,
   [role] INTEGER,
   [created_by] INTEGER,
   [updated_by] INTEGER,
   [created_at] TEXT,
   [updated_at] TEXT
);
CREATE TABLE [card_roles] (
   [id] INTEGER PRIMARY KEY,
   [title] TEXT,
   [deck] INTEGER,
   [short_name] TEXT,
   [published_at] TEXT,
   [created_by] TEXT,
   [updated_by] TEXT,
   [created_at] TEXT,
   [updated_at] TEXT
);
CREATE TABLE [decks] (
   [id] INTEGER PRIMARY KEY,
   [uuid] TEXT,
   [published_at] TEXT,
   [created_by] INTEGER,
   [updated_by] INTEGER,
   [created_at] TEXT,
   [updated_at] TEXT
);
CREATE TABLE [lines] (
   [id] INTEGER PRIMARY KEY,
   [line] TEXT,
   [card] INTEGER,
   [published_at] TEXT,
   [created_by] TEXT,
   [updated_by] TEXT,
   [created_at] TEXT,
   [updated_at] TEXT
);
CREATE TABLE [cards] (
   [id] INTEGER  NOT NULL PRIMARY KEY,
   [card_id] TEXT,
   [title] TEXT,
   [answer] TEXT,
   [number_in_role] INTEGER,
   [deck] INTEGER NOT NULL,
   [card_role] INTEGER,
   [tip] TEXT,
   [published_at] TEXT,
   [created_by] TEXT,
   [updated_by] TEXT,
   [created_at] TEXT,
   [updated_at] TEXT,
   [card_type] TEXT
);
COMMIT;
